import React, { Component } from 'react';
import { Route } from 'react-router-dom';

class About extends Component {
  render() {
    return (
      <div>
        <h2>About</h2>
        <p> My awesome About component </p>
        <Route path='/about' component={About}/>
      </div>
    );
  }
}

export default About;
